import './App.css';

const App = () => {
  const name = "Harshith";
  return (
    <div className="App">
      <h1> Hello there! </h1>
      {name ? (
        <>
          <h2> {name} </h2>
        </>
      ) : (
        <>
          <h2> Enter a name </h2>
        </>
      )}
    </div>
  );
}

export default App;
